[{"location":"matrices/","page":"Matrices","title":"Matrices","text":"CurrentModule = Destabilisation","category":"page"},{"location":"matrices/#Matrices","page":"Matrices","title":"Matrices","text":"","category":"section"},{"location":"matrices/","page":"Matrices","title":"Matrices","text":"Here some usefull functions are presented which return matrices which are for instance needed to fit a model to the recored data.","category":"page"},{"location":"matrices/","page":"Matrices","title":"Matrices","text":"Y","category":"page"},{"location":"matrices/#Destabilisation.Y","page":"Matrices","title":"Destabilisation.Y","text":"Y(traj::Matrix; p::Int64=1, T::Int64=100)\n\nThis function turns a trajectory traj which is a matrix with K rows into a matrix Y as defined     in Lütkepohls book in equation (3.2.1). If T+p excedes the length of the trajectory, i.e.     traj has less than T+p columns, then Y is retruned with T = size(traj)[2]-p. If on the      other hand the trajectory is longer than T+p then Y given by slicing the last T columns      out of traj.\n\n\n\n\n\n","category":"function"},{"location":"home/","page":"Home","title":"Home","text":"CurrentModule = Destabilisation","category":"page"},{"location":"home/#FiveBoxModel","page":"Home","title":"FiveBoxModel","text":"","category":"section"},{"location":"home/","page":"Home","title":"Home","text":"Documentation for Destabilisation.","category":"page"},{"location":"home/","page":"Home","title":"Home","text":"This model can be use to destabilize stochastic dynamical systems.","category":"page"},{"location":"formatTests/","page":"Format Test","title":"Format Test","text":"CurrentModule = Destabilisation","category":"page"},{"location":"formatTests/#Format-Test","page":"Format Test","title":"Format Test","text":"","category":"section"},{"location":"formatTests/","page":"Format Test","title":"Format Test","text":"These functions can be used to verify if a given object has indeed the desired format needed for the respecive application.","category":"page"},{"location":"formatTests/","page":"Format Test","title":"Format Test","text":"check_traj","category":"page"},{"location":"formatTests/#Destabilisation.FormatTests.check_traj","page":"Format Test","title":"Destabilisation.FormatTests.check_traj","text":"check_traj(traj)\n\nChecks if traj has the format of a trajectory i.e. if traj is a two dimentional matrix with all entries     given by numbers.\n\n\n\n\n\n","category":"function"},{"location":"","page":"Index","title":"Index","text":"CurrentModule = Destabilisation","category":"page"},{"location":"#Destabilisation","page":"Index","title":"Destabilisation","text":"","category":"section"},{"location":"","page":"Index","title":"Index","text":"Documentation for Destabilisation.","category":"page"},{"location":"","page":"Index","title":"Index","text":"","category":"page"},{"location":"","page":"Index","title":"Index","text":"Modules = [Destabilisation]","category":"page"},{"location":"#Destabilisation.Y-Tuple{Matrix}","page":"Index","title":"Destabilisation.Y","text":"Y(traj::Matrix; p::Int64=1, T::Int64=100)\n\nThis function turns a trajectory traj which is a matrix with K rows into a matrix Y as defined     in Lütkepohls book in equation (3.2.1). If T+p excedes the length of the trajectory, i.e.     traj has less than T+p columns, then Y is retruned with T = size(traj)[2]-p. If on the      other hand the trajectory is longer than T+p then Y given by slicing the last T columns      out of traj.\n\n\n\n\n\n","category":"method"}]
